import React, { useState } from "react";

function BillingApp() {
  const [bills, setBills] = useState([]);
  const [description, setDescription] = useState("");
  const [cost, setCost] = useState("");
  const [qty, setQty] = useState("");
  const [searchQuery, setSearchQuery] = useState("");

  const addBill = () => {
    if (description && cost && qty) {
      const total = parseInt(cost) * parseInt(qty);
      const newBill = {
        id: bills.length + 1,
        description,
        qty: parseInt(qty),
        cost: parseInt(cost),
        total,
      };
      setBills([...bills, newBill]);
      setDescription("");
      setCost("");
      setQty("");
    }
  };

  const filteredBills = searchQuery
    ? bills.filter((bill) =>
        bill.description.toLowerCase().includes(searchQuery.toLowerCase())
      )
    : bills;

  const totalAmount = filteredBills.reduce((sum, bill) => sum + bill.total, 0);

  return (
    <div
      style={{
        padding: "20px",
        fontFamily: "'Poppins', sans-serif",
        backgroundColor: "#F5EFE7",
        color: "#213555",
        minHeight: "100vh",
      }}
    >
      <h2
        style={{
          textAlign: "center",
          color: "#3E5879",
          fontSize: "2.5rem",
          marginBottom: "30px",
          textShadow: "2px 2px 4px #D8C4B6",
        }}
      >
        💵 Advanced Billing App
      </h2>

      <div
        style={{
          display: "grid",
          gridTemplateColumns: "1fr 1fr",
          gap: "20px",
          marginBottom: "30px",
        }}
      >
        <div
          style={{
            padding: "20px",
            border: "2px solid #D8C4B6",
            borderRadius: "15px",
            backgroundColor: "#FFFFFF",
            boxShadow: "0px 10px 15px rgba(0, 0, 0, 0.1)",
            transition: "all 0.3s ease-in-out",
          }}
        >
          <h3
            style={{
              textAlign: "center",
              color: "#213555",
              marginBottom: "15px",
            }}
          >
            Add New Bill
          </h3>
          <input
            type="text"
            placeholder="Description"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            style={{
              width: "100%",
              padding: "10px",
              marginBottom: "10px",
              border: "1px solid #D8C4B6",
              borderRadius: "8px",
            }}
          />
          <input
            type="number"
            placeholder="Cost"
            value={cost}
            onChange={(e) => setCost(e.target.value)}
            style={{
              width: "100%",
              padding: "10px",
              marginBottom: "10px",
              border: "1px solid #D8C4B6",
              borderRadius: "8px",
            }}
          />
          <input
            type="number"
            placeholder="Qty"
            value={qty}
            onChange={(e) => setQty(e.target.value)}
            style={{
              width: "100%",
              padding: "10px",
              marginBottom: "15px",
              border: "1px solid #D8C4B6",
              borderRadius: "8px",
            }}
          />
          <button
            onClick={addBill}
            style={{
              width: "100%",
              padding: "10px",
              backgroundColor: "#3E5879",
              color: "#FFFFFF",
              border: "none",
              borderRadius: "8px",
              cursor: "pointer",
              transition: "all 0.3s ease-in-out",
              fontWeight: "bold",
            }}
            onMouseOver={(e) =>
              (e.target.style.backgroundColor = "#213555")
            }
            onMouseOut={(e) =>
              (e.target.style.backgroundColor = "#3E5879")
            }
          >
            Add Bill
          </button>
        </div>

        <div
          style={{
            padding: "20px",
            border: "2px solid #D8C4B6",
            borderRadius: "15px",
            backgroundColor: "#FFFFFF",
            boxShadow: "0px 10px 15px rgba(0, 0, 0, 0.1)",
            transition: "all 0.3s ease-in-out",
          }}
        >
          <h3
            style={{
              textAlign: "center",
              color: "#213555",
              marginBottom: "15px",
            }}
          >
            Search Bill
          </h3>
          <input
            type="text"
            placeholder="Search by description"
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
            style={{
              width: "100%",
              padding: "10px",
              border: "1px solid #D8C4B6",
              borderRadius: "8px",
            }}
          />
        </div>
      </div>

      <div
        style={{
          marginBottom: "30px",
          border: "2px solid #3E5879",
          borderRadius: "15px",
          padding: "20px",
          backgroundColor: "#FFFFFF",
          boxShadow: "0px 10px 15px rgba(0, 0, 0, 0.1)",
        }}
      >
        <table
          style={{
            width: "100%",
            borderCollapse: "collapse",
            fontSize: "1rem",
            color: "#213555",
          }}
        >
          <thead>
            <tr>
              <th
                style={{
                  padding: "10px",
                  border: "1px solid #D8C4B6",
                  backgroundColor: "#3E5879",
                  color: "#FFFFFF",
                }}
              >
                ID
              </th>
              <th
                style={{
                  padding: "10px",
                  border: "1px solid #D8C4B6",
                  backgroundColor: "#3E5879",
                  color: "#FFFFFF",
                }}
              >
                Description
              </th>
              <th
                style={{
                  padding: "10px",
                  border: "1px solid #D8C4B6",
                  backgroundColor: "#3E5879",
                  color: "#FFFFFF",
                }}
              >
                Qty
              </th>
              <th
                style={{
                  padding: "10px",
                  border: "1px solid #D8C4B6",
                  backgroundColor: "#3E5879",
                  color: "#FFFFFF",
                }}
              >
                Cost
              </th>
              <th
                style={{
                  padding: "10px",
                  border: "1px solid #D8C4B6",
                  backgroundColor: "#3E5879",
                  color: "#FFFFFF",
                }}
              >
                Total
              </th>
            </tr>
          </thead>
          <tbody>
            {filteredBills.map((bill) => (
              <tr
                key={bill.id}
                style={{
                  textAlign: "center",
                  transition: "all 0.3s ease-in-out",
                  cursor: "pointer",
                }}
                onMouseOver={(e) =>
                  (e.target.style.backgroundColor = "#D8C4B6")
                }
                onMouseOut={(e) =>
                  (e.target.style.backgroundColor = "#FFFFFF")
                }
              >
                <td style={{ padding: "10px", border: "1px solid #D8C4B6" }}>
                  {bill.id}
                </td>
                <td style={{ padding: "10px", border: "1px solid #D8C4B6" }}>
                  {bill.description}
                </td>
                <td style={{ padding: "10px", border: "1px solid #D8C4B6" }}>
                  {bill.qty}
                </td>
                <td style={{ padding: "10px", border: "1px solid #D8C4B6" }}>
                  {bill.cost}
                </td>
                <td style={{ padding: "10px", border: "1px solid #D8C4B6" }}>
                  {bill.total}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div
        style={{
          fontWeight: "bold",
          textAlign: "center",
          border: "2px solid #3E5879",
          borderRadius: "15px",
          padding: "15px",
          backgroundColor: "#213555",
          color: "#FFFFFF",
        }}
      >
        Total Amount: ${totalAmount}
      </div>
    </div>
  );
}

export default BillingApp;




